import React, { useState, useEffect } from 'react';

const Card = ({ apiKey }, props) => {

    const [states, setStates] = React.useState([]);
    let statelist;
    const getStates = async () => {
        const response = await fetch('https://api.data.gov.in/resource/463d908b-c03b-47d3-b5bb-33d584d27f65?api-key=579b464db66ec23bdd000001cdd3946e44ce4aad7209ff7b23ac571b&format=json')
        setStates(await response.json());
        console.log(states);
        statelist = states.records;
    }


    useEffect(() => {
        getStates();
    }, [apiKey]);

    return (
        <div>
            {states.size}
            {statelist[0].population_2011}
        </div>
    )

}

export default Card;
